import './App.css';

class AddReview extends Component {

    // Initialize state
    state = {
        reviews: []
    }

    componentDidMount() {

    }



    render() {

        return (
            <div>
                <div>
                    <label>
                        {value} :
                        <input
                            name="fname"
                            type="text"
                            value={this.state.fname}
                            onChange={this.onInputChangeNum}
                        />
                    </label>
                </div>
                <div>
                    <label>
                        Last Name :
                        <input
                            name="lname"
                            type="text"
                            value={this.state.lname}
                            onChange={this.onInputchange}
                        />
                    </label>
                </div>
                <div>
                    <label>
                        Email :
                        <input
                            name="email"
                            type="text"
                            value={this.state.email}
                            onChange={this.onInputchange}
                        />
                    </label>
                </div>
                <div>
                    <button onClick={this.onSubmitForm}>Submit</button>
                </div>
            </div>
        );
    }
}

export default AddReview;
